import React, { useReducer } from 'react';
import {itemReducer} from '../reducers/ItemReducer';

interface Props {
        id:string,
        description:string
}



const ItemContainer:React.FC = ():JSX.Element => {
    const [state,dispatch] = useReducer(itemReducer, []);
    return(
        <div className="App">
            <p>Reminder Form</p>
            <section>
                <p>Reminder List</p>
            </section>
        </div>
    );
}

export default ItemContainer;
